result:
* {
  list-style: none;
}

.header {
  width: 100%;
  border-radius: 20px;
  background: #fff;
  padding: 30px 30px 30px 30px;
}

.name_list {
  display: flex;
  height: 20px;

  li {
    padding: 0 6px 0 6px;
    font-size: 12px;
    line-height: 20px;
  }

  li:hover {
    color: #7b91e2;
  }

  span {
    font-size: 14px;
    line-height: 18px;
  }
}

.select {
  margin-top: 40px;
  display: flex;

  .styles {
    margin-left: 40px;
  }

  li {
    span {
      font-size: 14px;
    }
  }
}

.addbtn {
  padding: 10px 40px 10px 40px;
  background: linear-gradient(-90deg, #4e75ff, #0139fd) !important;
  font-size: 14px;
  color: #fff;
}

.content {
  .con_list_left {
    font-size: 14px;

    .robot {
      color: #5959af;
    }

    .tab_list {
      margin-top: 20px;
    }

    .tab_list span:nth-child(1) {
      padding: 5px;
      border: 1px solid #91d5ff;
      background: #e6f7ff;
      color: #91d5ff;
    }

    .tab_list span:nth-child(2) {
      padding: 5px;
      border: 1px solid #adc6ff;
      background: #f0f5ff;
      color: #adc6ff;
    }

    .tab_list span:nth-child(3) {
      padding: 5px;
      border: 1px solid #ffd591;
      background: #fff7e6;
      color: #ffd591;
    }
  }

  .name_issue {
    color: #8439fd;
    margin-top: 20px;
  }

  .con_list_right {
    display: flex;
    align-items: center;
    color: #0139fd;
  }
}

.content_list {
  display: flex;
  justify-content: space-between;
  width: 100%;
  border-bottom: 1px solid #ccc;
  padding-top: 15px;
  padding-bottom: 10px;
}

.content_list:hover {
  background: #f7f8ff;
}
